import Item from "./item";

const select = ({selectData}) => {
    return <div className="select">
            {selectData.map((item) => {
                console.log(item);
                const {deptno, deptname} = item;
                return (
                    <Item
                        deptno={deptno}
                        deptname={deptname}
                    />
                );
            })
            }
    </div>
}

export default select
